INSERT INTO `cms_pages` (`id`, `title`, `description`, `url`, `meta_title`, `meta_description`, `meta_keywords`, `status`, `created_at`, `updated_at`) VALUES
(1, 'About Us', 'The “About Us” Page Broken Down: What Content Should You Include?\r\n\r\n\r\nGET THE PRINT VERSION\r\n\r\nTired of scrolling? Download a PDF version for easier offline reading and sharing with coworkers.\r\nDOWNLOAD PDF\r\n\r\nPicture this: you’re at a dinner party, and someone is talking your ear off about their new business. They can’t seem to describe it in words other than “innovative” and “great,” and you still have no idea what the company actually does. \r\n\r\nIf an ecommerce business were to bore you like this on their website, you wouldn’t even have to come up with an excuse to escape to the bathroom – you could just click off the page and be done. And that’s exactly what uninspired customers will do. \r\n\r\n91% of organizations worldwide use content marketing, but few of those organizations are using it as effectively as they could. If there’s a single crucial place to make sure your brand’s content is top notch, it’s on your About Us page. For customers, the About Us page is a one-stop introduction to your business, and there are plenty of expectations to exceed.', 'about-us', 'about E-commerce', 'about E-commerce cms page', 'E-commerce about', 1, '2021-07-31 18:44:15', '2021-08-03 11:38:27'),
(2, 'Privacy Policy', 'Coming soon privacy page', 'privacy-policy', 'privacy E-commerce', 'privacy policy E-commerce cms page', 'E-commerce privacy', 1, '2021-07-30 18:44:28', '2021-07-31 14:08:37'),
(6, 'Contact Us', 'About Us\r\nAbout ECommerce Partners:\r\nFounded in 1998, ECommerce Partners is a full-service, ecommerce and interactive agency headquartered in New York City. Best known for our unique process methodology, we combine Internet expertise, creative talent, and business know-how to help clients across a variety of industries achieve rapid, measurable online marketing results.', 'contact-us', 'contact us E-commerce', 'contact us E-commerce', 'contact us E-commerce', 1, '2021-08-01 04:40:38', '2021-08-03 12:05:35'),
(7, 'Your account', 'Let me give an example of success: A client of ours sold a product for $200. This was a unique product and was their own brand name, so no direct competition on the same SKU. Sales were around $400,000 the first year. Shipping on their product was around $50 a pop. People hated paying $50 and we saw a lot of people leaving their checkout process when choosing shipping. So what did we suggest? Offer free shipping and make the base price around $250. Their sales were in the millions the year after. The illusion of free shipping! This is a great option and works well for many clients. Remember, the higher your product price the more perceived value there is. No one sees value is paying for shipping, but they do when paying for a product.', 'your-account', 'your-account', 'your-account', 'your-account', 1, '2021-08-03 11:54:06', '2021-08-03 12:19:37'),
(8, 'Info page', 'What is an About Us Page? An About Us page is an opportunity to introduce your company on your own terms. It\'s where potential customers will go to find out why you\'re passionate about your products – and why they should be, too. A well-crafted About Us page is the key to building trust and loyalty with your customers.', 'info-page', 'info-page', 'info-page', 'info-page', 1, '2021-08-03 11:55:22', '2021-08-03 11:55:22'),
(9, 'Order history', 'Whether you offer free shipping site-wide or limit your promotion to specific categories and products, your customers can browse confidently knowing that the prices listed are what they\'ll actually pay (plus a little for Uncle Sam, when applicable). Plus, they won\'t be caught off guard with additional charges when they\'re ready to checkout. From a psychological perspective, you\'ll be at an advantage if your visitors are confident that the price they see is an accurate representation of their final cost.', 'order-history', 'order-history', 'order-history', 'order-history', 1, '2021-08-03 11:56:27', '2021-08-03 12:21:01'),
(10, 'Term condition', 'Generate Terms of Service for websites\r\nCreating a Terms of Service for your application or website can take a lot of time. You could either spend tons of money on hiring a lawyer, or you could simply use our service and get a unique Terms of Service fully custumized to your website.', 'term-condition', 'term-condition', 'term-condition', 'term-condition', 1, '2021-08-03 11:57:41', '2021-08-03 12:16:22'),
(11, 'Faq page', 'FAQs are one of the top ways to stay on your customers’ minds these days.\r\n\r\nIrrespective of the type of products or services you sell, the industry you’re in, an FAQ page or a small section for the same must be available in your online store.\r\n\r\nCheck out how fashion eCommerce brands must launch their online store with an FAQ page/section.\r\nEven home decor eCommerce website features are incomplete without an FAQ page/section.\r\nAlmost every business, every industry needs a FAQ page or section within their online store. But, what is it? Why businesses need them? How to build an FAQ page?\r\n\r\nLet’s learn everything in detail.\r\n\r\nWhat is a FAQ Page/FAQ section?\r\nFAQ stands for Frequently Asked Questions. FAQs are the questions that your customers might have, which you can answer in advance.\r\n\r\nSo, an FAQ page or section is a specific page or a section within your eCommerce store where you list down all the questions your customers might have or ask them frequently regarding your business, products/services, policies, processes, and more.\r\n\r\nWhy should you have FAQs for eCommerce website or product pages?\r\nMost eCommerce businesses have this question, “what is the purpose of a FAQ?”. To answer this, here are the benefits of having a FAQ page or section on your eCommerce store-\r\n\r\n1. Improves user experience\r\nOne of the top advantages of having FAQs on your eCommerce store is to improve the user experience. \r\n\r\nFAQs consists of questions that your customers frequently have. Hence, addressing them and answering them keeps them informed about your products. When they feel their queries are being listened to and answered, users, are more likely to trust your products as well as your brand.\r\n\r\n\r\n \r\nAnd, customer experience has become the topmost factor for the success of any eCommerce business. So, having it, ensures you’re making your customers happy and satisfied.\r\n\r\n2. Increases conversions\r\nAnother key reason to have eCommerce FAQs is to increase conversions. Most online buyers have some or the other queries related to your product, its size, the delivery options, and more.\r\n\r\nIf such queries are addressed appropriately at the right moment, it can help the potential buyers to make the buying decision faster. That’s how FAQs invoke the speed for conversions.\r\n\r\n3. Saves time and money on customer services\r\nEarlier, customers used to email or call the customer support executives to find their answers. Such efforts can be saved with the help of eCommerce FAQs. \r\n\r\nOn top of that, you serve better with FAQs compared to the emails and phone calls. Your customers feel you’ve saved their time in figuring out whether this is the right product for them or not.\r\n\r\nSo, a good job here!\r\n\r\nNot all queries can be resolved using FAQs, but the general ones can be. Make sure you include all the general queries in your FAQs.\r\n\r\n4. Boosts SEO results\r\nUndoubtedly, frequently asked questions (FAQs) have a massive impact on SEO. When you include FAQs exactly the way they’re asked on the search engines, it can help you boost your product keyword rankings.\r\n\r\nAlso, today, there is a huge demand for voice shopping, and voice search is considered as one of the trending things in the entire digital world.', 'faq-page', 'faq-page', 'faq-page', 'faq-page', 1, '2021-08-03 11:59:52', '2021-08-03 11:59:52'),
(12, 'New products', '\'New products\' can be: products that your business has never made or sold before but have been taken to market by others. product innovations created and brought to the market for the first time. They may be completely original products, or existing products that you have modified and improved', 'new-products', 'new-products', 'new-products', 'new-products', 1, '2021-08-03 12:01:08', '2021-08-03 12:01:08'),
(13, 'Top seal', 'To be a world-best company that serves for both customers and employees with TOP quality cartridges and sealants ... Play the Topseal Video ...', 'top-seal', 'top-seal', 'top-seal', 'top-seal', 1, '2021-08-03 12:02:03', '2021-08-03 12:02:03'),
(14, 'Special offer', 'No matter how successful your eCommerce website is, you should always be brainstorming for ways to improve it using eCommerce promotions and online sales.\r\n\r\nDeveloping innovative eCommerce promotion ideas can be tough, but will ultimately pay off in dividends when implemented correctly on your eCommerce website. Offering promotions and special offers to your potential customers is an effective method of driving ancillary traffic to your site, acquiring new customers, and increasing online sales and revenue. Best of all, these online sales can also be used to encourage new visitors to become loyal, repeat customers. Many shopping cart platforms offer promotion functionality within their eCommerce features, so take advantage of them!', 'special-offer', 'special-offer', 'special-offer', 'special-offer', 1, '2021-08-03 12:03:12', '2021-08-03 12:17:40');
